import React from "react";

import css from "./App.css";
import Home from "./routes/Home";

function App() {
  return (
    <>
      {/* Nav-Start */}
      <div className="Nav">
        <img src="" alt="로고" className="nav-logo"></img>
        <div className="nav-item">
          <div>Home</div>
          <div>카테고리1</div>
          <div>카테고리2</div>
        </div>
      </div>
      {/* Nav-End */}

      <Home />
    </>
  );
}

export default App;
